webpackJsonp([0xcf60c37a3b39],{6938:function(e,t){e.exports={data:{post:{html:"<p>We  tried to tell my mother-in-law that she did not have to come feed our cat Nena while we were gone this weekend. I mean, we were only gone two days, and cats can survive for weeks without human attention. But she has a key to the house (my mother-in-law, not Nena), so we couldn't stop her. And she was shocked as Nena brought a mouse to the patio, and proceeded to eat the mouse, completely, on the spot, from head to tail.</p>\n<p>My mother-in-law loves cats, as she remembers the kitten she had as a young girl, but has never had a cat since her childhood, and thus doesn't really understand cats at all.</p>\n<p>I thought Nena was being quite considerate to her guest host. Usually she leaves the head for us to pick up in the morning.</p>",fields:{title:"Cat and Mouse",date:"01 Aug 2004",url:"https://papascott.de/2004-08-01-cat-and-mouse/"}}},pathContext:{slug:"/2004-08-01-cat-and-mouse/",prev:{fields:{title:"Beach Culture",date:"01 Aug 2004",slug:"/2004-08-01-beach-culture/"}},next:{fields:{title:"BILDblog",date:"02 Aug 2004",slug:"/2004-08-02-bildblog/"}}}}}});
